// 解析 DeepSeek Reasoner 响应
const response = $input.item.json;

// 提取 reasoning_content (思考过程) 和 content (最终回答)
const reasoning = response.choices?.[0]?.message?.reasoning_content || '';
const content = response.choices?.[0]?.message?.content || '';

// 尝试从 content 中提取 JSON
let parsedResult;
try {
  // 查找 JSON 代码块
  const jsonMatch = content.match(/```json\s*([\s\S]*?)\s*```/);
  if (jsonMatch) {
    parsedResult = JSON.parse(jsonMatch[1]);
  } else {
    // 尝试直接解析
    parsedResult = JSON.parse(content);
  }
} catch (e) {
  // 如果解析失败，使用原始内容
  parsedResult = {
    thinking: reasoning,
    next_question: content,
    extracted_info: {},
    finished: false,
    updated_slots: []
  };
}

// 计算新的完成度
const currentState = $('Extract Input').item.json.current_state || { slots: [], completion_rate: 0 };
let updatedSlots = currentState.slots || [];

// 更新槽位
if (parsedResult.updated_slots && parsedResult.updated_slots.length > 0) {
  updatedSlots = updatedSlots.map(slot => {
    const update = parsedResult.updated_slots.find(u => u.name === slot.name);
    if (update) {
      return { ...slot, ...update };
    }
    return slot;
  });
}

// 计算完成度
const filledCount = updatedSlots.filter(s => s.filled).length;
const totalCount = updatedSlots.length;
const completionRate = totalCount > 0 ? Math.round((filledCount / totalCount) * 100) : 0;

return {
  question: parsedResult.next_question || '',
  thinking: parsedResult.thinking || reasoning || '',
  extracted_info: parsedResult.extracted_info || {},
  finished: parsedResult.finished || false,
  completion_message: parsedResult.completion_message || '',
  updated_state: {
    slots: updatedSlots,
    completion_rate: completionRate
  }
};

